      return (
        <div className="title">
          <div className="h1 text-center">Markdown Previewer</div>
          <div className="author text-center">Coded by <a href="https://codepen.io/your-work">Minh Duc Nguyen</a></div>
        </div>
      );
    }
};

export default Title;
